import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import IconButton from '@mui/material/IconButton';
import MailIcon from '@mui/icons-material/Mail';
import Badge from '@mui/material/Badge';
import NotificationsIcon from '@mui/icons-material/Notifications';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Typography from '@mui/material/Typography';
import ButtonBase from '@mui/material/ButtonBase';
import { styled } from '@mui/material/styles';

const Button1 = styled(ButtonBase)(({ theme }) => ({
    position: 'relative',
    '&:hover, &.Mui-focusVisible': {
        zIndex: 1,

        '& .MuiImageBackdrop-root': {
            opacity: 0.15,
        },
        '& .MuiImageMarked-root': {
            opacity: 0,
        },
        '& .MuiTypography-root': {
            border: '1px solid currentColor',
            borderRadius: '10px',
            paddingTop: 8,
            height: 40
        },
    },
}));

const ImageMarked = styled('span')(({ theme }) => ({
    height: 2,
    width: 18,
    backgroundColor: theme.palette.common.white,
    position: 'absolute',
    bottom: 10,
    left: 'calc(50% - 9px)',
    transition: theme.transitions.create('opacity'),
}));

const MobileMenu = props => {
    const isMobileMenuOpen = Boolean(props.mobileMoreAnchorEl)
    return (
        <Menu
            anchorEl={props.mobileMoreAnchorEl}
            anchorOrigin={{ vertical: "top", horizontal: "right", }}
            id={props.mobileMenuId}
            keepMounted
            transformOrigin={{ vertical: "top", horizontal: "right" }}
            open={isMobileMenuOpen}
            onClose={props.onClose}>

            <MenuItem>
                <Button1 focusRipple textalign='center'>
                    <Typography
                        component="span"
                        variant="button"
                        onClick={props.aboutHandler}
                        color="inherit"

                        sx={{
                            position: 'relative',
                            p: 2,
                            pt: 0,
                            pb: (theme) => `calc(${theme.spacing(2)} + 4px)`,
                        }} >
                        About Us
                        <ImageMarked className="MuiImageMarked-root" />
                    </Typography>
                </Button1>
            </MenuItem><MenuItem>
                <Button1 focusRipple textalign='center'>
                    <Typography
                        component="span"
                        variant="button"
                        onClick={props.loginHandler}
                        color="inherit">


                        Login

                    </Typography>
                </Button1>
            </MenuItem>
            <MenuItem>
                <IconButton size="large" aria-label='show 4 new mails' color="inherit">
                    <Badge badgeContent={4} color="error"><MailIcon /></Badge>
                    <p>Messages</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton size="large" aria-label='show 17 new notifications' color="inherit">
                    <Badge badgeContent={17} color="error"><NotificationsIcon /></Badge>
                    <p>Notifications</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton
                    size="large"
                    aria-label='account of currunt user'
                    aria-haspopup="true"
                    aria-controls={props.mobileMenuId}
                    // onClick={props.onOpen} 
                    color="inherit">
                    <AccountCircle />
                    <p>Profile</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton
                    size="large"
                    aria-label='account of currunt user'
                    aria-haspopup="true"
                    aria-controls={props.mobileMenuId}
                    // onClick={props.onOpen}
                    color="inherit">
                    <AccountCircle />
                    <p>Account</p>
                </IconButton>
            </MenuItem>

        </Menu>
    );
};
export default MobileMenu;
